import { StyledHeader,Nav,Button,Logo } from "./components/styles/Header.styled";

export default function() {
   
    return(
        <>
            <StyledHeader>
                <Container>
                    <h1>Header</h1>
                    <Nav>
                        <Logo src="" />
                        {/* <Button>Try it Free</Button> */}
                    </Nav>
                    {/* <div>

                    </div> */}
                </Container>
            
            </StyledHeader>
        </>
    )
}
